INSERT INTO `t_article` VALUES (236, 1, '活动公告', '2321321', '<p><img src=\"http://47.52.118.98:9090/ajax/libs/layui/images/face/60.gif\" alt=\"[神马]\"><img src=\"http://47.52.118.98:9090/ajax/libs/layui/images/face/71.gif\" alt=\"[蛋糕]\"><img src=\"http://47.52.118.98:9090/ajax/libs/layui/images/face/66.gif\" alt=\"[奥特曼]\"><br></p><p><br></p><p><img src=\"https://futrade.oss-cn-beijing.aliyuncs.com/test/banner/article_18121214195305766dd933b0fccd15bc1154cc0e7b40.png\" alt=\"https://futrade.oss-cn-beijing.aliyuncs.com/test/banner/article_18121214195305766dd933b0fccd15bc1154cc0e7b40.png\"><br></p><p><br></p><p><img src=\"http://47.52.118.98:9090/ajax/libs/layui/images/face/38.gif\" alt=\"[哼]\"><img src=\"http://47.52.118.98:9090/ajax/libs/layui/images/face/38.gif\" alt=\"[哼]\">我试试效果<br></p><p><br></p><p><br></p>', NULL, b'1', b'0', 0, 0, 4, 0, '2018-12-15 14:19:39', '2018-12-12 14:20:55', '2018-12-22 14:19:42', NULL);
INSERT INTO `t_article` VALUES (238, 4, '浮动盈亏计算方式', '浮动盈亏计算方式', '<p>（当前价格-开仓价格）*持仓手数*合约浮动点位价值=浮动盈亏</p>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:05:22', '2018-12-12 15:05:22', NULL, NULL);
INSERT INTO `t_article` VALUES (239, 4, '什么条件下会进行强制平仓？', '什么条件下会进行强制平仓？', '<p class=\"p\"><span><font face=\"微软雅黑\">当账户的保证金比率（净值</font>/占用保证金）低于 70% 时，系统会进行强制平仓。</span><span></span></p><p class=\"p\"><span><font face=\"微软雅黑\">因此，请您务必留意监控账户资金情况。</font></span><span></span></p><p class=\"p\"><span><font face=\"微软雅黑\">强制平仓将按照账户中亏损金额顺序，从亏损金额最大的仓单开始执行强制平仓。</font></span><span></span></p><p class=\"p\"><span><font face=\"微软雅黑\">强制平仓规则：</font></span><span></span></p><p class=\"p\"><span>1）先计算所有持仓单（包括已锁仓）之亏损最大开始逐单自动强平。</span><span></span></p><p class=\"p\"><span>2）若持仓单同时出现相同亏损，以先入先出（First In First Out）的原则强平。</span><span></span></p><span>3）若开仓时间相同，则以订单号排序区分，较前的订单号将会先被强平。</span>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:06:45', '2018-12-12 15:06:45', NULL, NULL);
INSERT INTO `t_article` VALUES (240, 4, '交易一手的保证金是多少？', '交易一手的保证金是多少？', '<p>平台的保证金比例为 5%（杠杆 1:20）和 2%(杠杆1:50)，交易一手的保证金金额将根据交易品种及其市场价格而不同。具体请以交易终端或交易页面显示为准。</p>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:07:25', '2018-12-12 15:07:25', NULL, NULL);
INSERT INTO `t_article` VALUES (241, 4, '充值提现', '充值提现', '<p class=\"MsoNormal\"><span><font face=\"微软雅黑\">充值为人民币充值，完成充值后将获得对应的</font>USDT，由于USDT/CNY的汇率是浮动的，所以每次充值需要根据最新汇率来计算。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">提现为输入需要输入</font>USDT后，发起申请提现，当审核通过后，资金将打到实名认证的银行卡中。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>平台使用什么货币进行交易？</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">目前置顶账户结算未</font>USDT。</span><span></span></p>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:08:02', '2018-12-12 15:08:02', NULL, NULL);
INSERT INTO `t_article` VALUES (242, 4, '风险率是什么？', '风险率是什么？', '<p class=\"MsoNormal\"><span><font face=\"微软雅黑\">风险率为保护用户资金权益的一种。当用户浮动亏损资金达到总资金的</font>30%时，平台将正在进行的永续合约持仓单自动平仓。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>风险率是平台为了保护用户权益的风险控制机制，当</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">账户风险率低于</font>70%时，永续合约持仓单将会被强制</span><span></span></p><p class=\"MsoNormal\"><span>平仓</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">风险率</font>=净值/冻结保证金 * %</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">净值</font>=余额+浮动盈亏</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>因此，请您务必留意监控账户资金情况。</span></p><p class=\"MsoNormal\"><span>强制平仓将按照账户中亏损金额顺序，从亏损金额最大的仓单开始执行强制平仓。</span><span></span></p>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:08:33', '2018-12-12 15:08:33', NULL, NULL);
INSERT INTO `t_article` VALUES (243, 4, '永续合约规则', '永续合约规则', '<p class=\"MsoNormal\"><span>永续合约既无交割时间的期货合约，永续合约提供高杠杆下单服务。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>合约价值：</span><span></span></p><p class=\"MsoNormal\"><span>BTC/USDT: 1手=1BTC</span><span></span></p><p class=\"MsoNormal\"><span>ETH/USDT: 1手=20ETH</span><span></span></p><p class=\"MsoNormal\"><span>LTC/USDT: 1手=100LTC</span><span></span></p><p class=\"MsoNormal\"><span>EOS/USDT: 1手=1250EOS</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>杠杆：</span><span></span></p><p class=\"MsoNormal\"><span>50倍、20倍</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>保证金：</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">平台的保证金比例为</font> 5%（杠杆 1:20）和 2%(杠杆1:50)，交易一手的保证金金额将根据交易品种及其市场价格而不同。具体请以交易终端或交易页面显示为准。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">交易手续费：</font></span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">交易手续费为</font>0.05%，计算公式为合约价值*手数*0.05%</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">浮动盈亏：</font></span><span></span></p><p class=\"MsoNormal\"><span>Futrade创新浮动盈亏玩法，看涨BTC，则BTC上涨1USDT，则用户可以获得1USDT的利润。ETH上涨1USDT则可获得20USDT利润。LTC上涨1美金则可获得100USDT。EOS上涨1USDT则上涨1250USDT。</span><span></span></p><p class=\"MsoNormal\"><span>BTC：1USDT/点位</span><span></span></p><p class=\"MsoNormal\"><span>ETH：20USDT/点位</span><span></span></p><p class=\"MsoNormal\"><span>LTC: &nbsp;100USDT/点位</span><span></span></p><p class=\"MsoNormal\"><span>EOS：1250USDT/点位</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>下单手数：</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">最小</font>0.1手，最大20手</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>风险率爆仓：</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">规则：当账户风险率小于等于</font>70%时，将对所有持仓订单(永续合约持仓单)进行强制爆仓。</span><span></span></p><p class=\"MsoNormal\"><span>爆仓规则：</span><span></span></p><p class=\"MsoNormal\"><span>1.筛选持仓单中亏损最大订单，进行逐一平仓，直到风险率高于70%为止</span><span></span></p><p class=\"MsoNormal\"><span>2.若持仓单出现相同亏损，以先入先出原则强平</span><span></span></p><p class=\"MsoNormal\"><span>3.若开仓时间相同，则以订单号排序，较前订单号将会先被强平</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">账户风险率</font>=净值/占用保证金*%</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">净值</font>=账户余额+浮动盈亏</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">账户余额</font>=自上次平仓清算以来账户余额</span><span></span></p><p class=\"MsoNormal\"><span>已用保证金：持有未平仓的保证金总和</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">可用保证金：净值</font>-已用=可用</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">附加说明：当浮动盈亏已经亏损金额大于开仓保证金，不终止合约，合约继续进行，多出的亏损部分在可用余额中扣除，直到风险率达到</font>70%才自动爆仓</span><span></span></p>', NULL, b'1', b'0', 0, 0, 5, 0, '2018-12-12 15:09:06', '2018-12-12 15:09:06', NULL, NULL);
INSERT INTO `t_article` VALUES (244, 4, '微合约规则', '微合约规则', '<p class=\"MsoNormal\"><span>微合约交易是预测相关虚拟货币资产价格在一定时间段内是涨还是跌的一种金融工具。此类交易，你不是购买或出售资产，仅仅是猜测价格变动方向。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>标准短期合约的核心是预测标的资产在一定时间内的走向，投资者不需要实质购买或拥有资产，只需预测资产变化的趋势。在到期只有两种可能结果。基于一种资产在规定时间内收盘价格是低于还是高于执行价格的结果，决定是否获得收益。简单来说用户只需要对于价格变化的方向做出一个决定，是涨是跌即可。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>交易时间：</span><span></span></p><p class=\"MsoNormal\"><span>虚拟货币期货交易为</span><span>T+0，24小时交易。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>如何交易？</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">首先选择需要下单的保证金额，其次选择时间，不管涨跌的幅度是多少，只要你的方向在时间到期时时正确的，则可以获得投入本金的</font>90%的利润。若判断失败，则没收本金。</span><span></span></p><p class=\"MsoNormal\"><span>1.&nbsp;</span><span><font face=\"微软雅黑\">选择到期时间（</font>1分钟、3分钟、5分钟、10分钟、15分钟）</span><span></span></p><p class=\"MsoNormal\"><span>2.&nbsp;</span><span>选择交易对交易</span><span></span></p><p class=\"MsoNormal\"><span>3.&nbsp;</span><span>选择投资金额</span><span></span></p><p class=\"MsoNormal\"><span>4.&nbsp;</span><span>选择看涨或看跌</span><span></span></p><p class=\"MsoNormal\"><span>5.&nbsp;</span><span>下单后，等待到期时间，系统将自动结算</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">买涨获利：交割时间行情价格</font>&gt;开仓价，则买涨方向盈利。</span><span></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">买跌获利：交割时间行情价格</font>&lt;开仓价，则买跌方向盈利。</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">手续费：下单保证金</font>*10%</span><span></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p>', NULL, b'1', b'0', 0, 0, 5, 1, '2018-12-12 15:09:32', '2018-12-12 15:09:32', NULL, '2019-01-08 17:01:00');
