INSERT INTO `t_article` VALUES (261, 3, '通知', '通知', '每次抢完狗狗，一定要再次登陆账号确认是否有领养中未付款的订单。进入申诉区将直接封号，每个账号只有2次解封机会，第3次永久封号！', NULL, b'1', b'0', 0, 0, 1, 1, '2019-08-01 03:10:28', '2019-08-01 03:10:28', NULL, NULL);
INSERT INTO `t_article` VALUES (265, 3, '贝塔游戏板块实行交易解锁机制', '贝塔游戏板块实行交易解锁机制', '<p>喜迎贝塔公主上线，游戏公链开发及游戏生态正式启动，平台的运营优化解决方案如下：&nbsp;</p>\n<p>贝塔游戏板块实行交易解锁机制（备注：此机制仅适用于8月1日之前注册的会员），按玩家当天新领养宠物的总价值，次日解锁该玩家账户最高2 倍价值的游戏宠物匹配额度。</p>\n<p>示例：玩家 A 当天领养 10000 总价值的游戏宠物狗，次日在待转让区内，可将最高总价值最高 20000 的游戏宠物狗进行交易。</p>', NULL, b'1', b'0', 0, 0, 1, 1, '2019-08-08 11:56:19', '2019-08-08 11:56:19', NULL, NULL);
INSERT INTO `t_article` VALUES (266, 3, '公告', '公告', '<p>平台即日起执行如下游戏运营方案</p>\n<p>1.贝塔游戏团队按原定计划，于八月内启动第二款区块链游戏，</p>\n<p>具体游戏运营方案另行通知。</p>\n<p>2.实施贝塔链商学院全球社区计划</p>\n<p>3.实施贝塔区块链游戏全生态计划。</p>\n<p>4.实施贝塔链社区治理计划。</p>\n<p>5.对18:00和20:30的游戏宠物狗增加收益率。</p>\n<p>6.平台将根据实时数据，对各场次游戏宠物狗匹配额度做出合理的调整。</p>', NULL, b'1', b'0', 0, 0, 1, 1, '2019-08-14 10:14:53', '2019-08-14 10:14:53', NULL, NULL);
