-- ----------------------------
DROP TABLE IF EXISTS `g_beta_male`;
CREATE TABLE `g_beta_male`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '公狗ID',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `combo_id` int(11) NOT NULL COMMENT '关联套餐ID',
  `price` decimal(15, 2) NOT NULL COMMENT '公狗价格',
  `earnings_price` decimal(15, 2) NOT NULL COMMENT '收益价',
  `premium_stauts` tinyint(1) NOT NULL DEFAULT 1 COMMENT '溢价状态（1=未溢价，2=已溢价）',
  `presell_time` datetime(0) NOT NULL COMMENT '预售时间(年月日)',
  `beta_activate` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否激活（0=未激活，1=已激活）----何为激活，意思就是此狗已绑定创世用户，可以预约出售了',
  `user_id` bigint(20) NULL DEFAULT 1 COMMENT '公狗最新所属用户ID（公狗未激活之前需要手动分配用户，然后在激活出售）',
  `order_id` int(11) NULL DEFAULT NULL COMMENT '公狗对应最新订单的ID---出售公狗时以此订单为准',
  `sell_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '出售状态（0=未出售，1=已出售），用于出售过程中标记此狗是否被别人下单',
  `platform_and_user` tinyint(1) NOT NULL DEFAULT 0 COMMENT '平台创建还是用户创建（0.未知 1.平台 2.用户团队收益3.用户推广收益）',
  `user_info` bigint(20) NULL DEFAULT NULL COMMENT '初始用户',
  `mating_state` int(1) NULL DEFAULT 0 COMMENT '交配状态（0否,1是）',
  `parent_id` int(11) NULL DEFAULT NULL COMMENT '父级公狗ID',
  `wait_sum` int(11) NULL DEFAULT 0 COMMENT '滞留天数',
  `unfreeze_flag` int(11) NULL DEFAULT 0 COMMENT '到期是否解冻（0否,1是）',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `combo_id`(`combo_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 99618 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

