-- ----------------------------
-- Table structure for g_beta_order
-- ----------------------------
DROP TABLE IF EXISTS `g_beta_order`;
CREATE TABLE `g_beta_order`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '公狗ID',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `register_time` datetime(0) NULL DEFAULT NULL COMMENT '登记时间(领养登记时间--待支付状态)',
  `order_number` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT '订单编号',
  `user_id` bigint(22) NULL DEFAULT NULL COMMENT '订单所属用户ID',
  `femina_id` int(11) NULL DEFAULT NULL COMMENT '关联公狗表ID',
  `combo_id` int(11) NOT NULL COMMENT '套餐表ID',
  `price` decimal(15, 2) NOT NULL COMMENT '公狗价格',
  `earnings_price` decimal(15, 2) NOT NULL COMMENT '收益价',
  `differential` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '领养消费BETA',
  `order_stauts` tinyint(1) NOT NULL COMMENT '订单状态（-1=隐藏，0=取消，1=完成，2=待转让，3=待支付，4=待放狗，5=客诉）',
  `order_stauts_type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单状态类型（0=未知，订单状态为0取消时：1=买方超时取消，2=客服取消）',
  `pay_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '付款图片',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  `lawsuit_content` varchar(4000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客诉内容',
  `succeed_time` datetime(0) NULL DEFAULT NULL COMMENT '成交时间',
  `sell_user_id` bigint(22) NOT NULL COMMENT '绑定出售人ID--每条狗出售必定有绑定出售人',
  `settling_time` datetime(0) NULL DEFAULT NULL COMMENT '推广结算日期',
  `buy_user_id` bigint(22) NULL DEFAULT NULL COMMENT '绑定购买人ID---如果购买人届时没有付款，此ID会自动清除，用户的狗就可以进入下一轮预约出售。',
  `version` int(11) NOT NULL DEFAULT 0 COMMENT '版本号',
  `generalize_time` datetime(0) NULL DEFAULT NULL COMMENT '团队结算日期',
  `unique_index` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '唯一索引',
  `order_mating_state` int(11) NULL DEFAULT 0 COMMENT '交配状态（0否,1是）',
  `push_flag` int(1) NULL DEFAULT 0 COMMENT '是否结算上级出售额度0=否1=是',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unique_index_user_id`(`unique_index`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `sell_user_id`(`sell_user_id`) USING BTREE,
  INDEX `femina_id`(`femina_id`) USING BTREE,
  INDEX `order_stauts`(`order_stauts`) USING BTREE,
  INDEX `order_number`(`order_number`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 707790 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

