  `agility` int(10) NULL DEFAULT 0 COMMENT '敏捷',
  `stamina` int(10) NULL DEFAULT 0 COMMENT '体力',
  `intelligence` int(10) NULL DEFAULT 0 COMMENT '智力',
  `charm` int(10) NULL DEFAULT 0 COMMENT '魅力',
  `total_count` int(10) NULL DEFAULT -1 COMMENT '总数量',
  `stock_count` int(10) NULL DEFAULT -1 COMMENT '库存',
  `buy_limit` int(10) NULL DEFAULT 1 COMMENT '限制购买数量',
  `status` tinyint(1) NULL DEFAULT NULL COMMENT '状态(-1删除,0:未公开 1:出售 2:停售 3:不显示)',
  `remark` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `be_suitable` int(2) NULL DEFAULT 1 COMMENT '适用 1.母狗 2.小狗',
  `overlay_limit` int(10) NULL DEFAULT 1 COMMENT '叠加限制',
  `validity_period` int(10) NULL DEFAULT -1 COMMENT '有效期',
  `speed_up_time` int(10) NULL DEFAULT 0 COMMENT '道具提速提速时间（秒）',
  `show_position` int(3) NULL DEFAULT 3 COMMENT '商品展示位置 0 衣服1 宅基地 2 狗舍 3 道具',
  `expend_type` int(3) NULL DEFAULT 2 COMMENT '消耗类型  1次性消耗，2永久商品',
  `give_currency_status` int(1) NULL DEFAULT 0 COMMENT '是否送币1是 0否',
  `account_config_id` int(10) NULL DEFAULT NULL COMMENT '币种ID',
  `account_num` decimal(15, 4) NULL DEFAULT NULL COMMENT '送币数量',
  PRIMARY KEY (`id`) USING BTREE
