DROP TABLE IF EXISTS `t_contract_micro`;
CREATE TABLE `t_contract_micro`  (
  `order_id` bigint(64) NOT NULL COMMENT '订单ID',
  `client_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'M' COMMENT '交易订单号增加平台区分（M、Android、iOS）',
  `user_id` bigint(20) NULL DEFAULT NULL COMMENT '用户ID',
  `product_id` int(11) NULL DEFAULT NULL COMMENT '产品ID',
  `direction` int(1) NULL DEFAULT NULL COMMENT '方向（涨/跌）：1-买跌，2-买涨',
  `token_order` int(1) NULL DEFAULT 1 COMMENT '体验金订单（1=正常订单，2=体验金订单）',
  `open_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '建仓价',
  `market_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '市价',
  `close_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '平仓价',
  `multiple` int(11) NULL DEFAULT NULL COMMENT '倍数（10、20、50......）',
  `lots` decimal(6, 1) NULL DEFAULT NULL COMMENT '手数',
  `slippage` decimal(15, 4) NULL DEFAULT NULL COMMENT '滑点',
  `used_margin` decimal(15, 4) NULL DEFAULT NULL COMMENT '占用保证金',
  `profit_loss` decimal(15, 4) NULL DEFAULT NULL COMMENT '盈亏',
  `profit_percent` decimal(15, 4) NULL DEFAULT NULL COMMENT '利润百分比',
  `service_fee` decimal(15, 4) NULL DEFAULT NULL COMMENT '手续费',
  `status` int(1) NULL DEFAULT NULL COMMENT '状态：1-建仓 2-平仓',
  `delivery_time` int(11) NULL DEFAULT NULL COMMENT '交割时间(分钟单位)',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `isShow` tinyint(2) NULL DEFAULT 1 COMMENT '是否显示:0不显示，1显示',
  `open_time` datetime(0) NULL DEFAULT NULL COMMENT '建仓时间',
  `close_time` datetime(0) NULL DEFAULT NULL COMMENT '平仓时间',
  `fact_close_time` datetime(0) NULL DEFAULT NULL COMMENT '实际交割时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `product_id`(`product_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '微盘合约订单' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_contract_perpetual
