  `open_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '建仓价',
  `market_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '市价',
  `close_price` decimal(15, 4) NULL DEFAULT NULL COMMENT '平仓价',
  `multiple` int(11) NULL DEFAULT NULL COMMENT '倍数（10、20、50......）',
