  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `low` decimal(20, 10) NULL DEFAULT NULL COMMENT '最低价格',
  `high` decimal(20, 10) NULL DEFAULT NULL COMMENT '最高价格',
