-- ----------------------------
-- Table structure for t_product_micro
-- ----------------------------
DROP TABLE IF EXISTS `t_product_micro`;
CREATE TABLE `t_product_micro`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `symbol` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '标志',
  `code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '代号',
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `quantity_unit` int(11) NULL DEFAULT NULL COMMENT '数量单位（合约量）（/手）',
  `margin_money` decimal(15, 4) NULL DEFAULT 320.0000 COMMENT '保证金（USDT）',
  `value_unit` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微合约保证金选择数组（3,6,9,12,.....）',
  `time_unit` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微合约时间选择数组（3,6,9,12,.....）',
  `service_fee` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '微合约手续费',
  `real_slippage` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '真实资金滑点（范围）',
  `slippage_range` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '交易量范围',
  `slippage` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '滑点（体验金）',
  `spread_up` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '向上点差（USDT）',
  `spread_down` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '向下点差',
  `token_spread_up` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '体验金下单看涨点差',
  `token_spread_down` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '体验金下单看跌点差',
  `is_sort` int(2) NULL DEFAULT NULL COMMENT '是否排序',
  `profit_percent` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '利润百分比',
  `contract_value` int(11) NULL DEFAULT NULL COMMENT '固定合约金额交易对一手合约价值',
  `status` int(1) NULL DEFAULT NULL COMMENT '状态:0-禁用,1-启用',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of t_product_micro
-- ----------------------------

-- ----------------------------
-- Table structure for t_product_perpetual
-- ----------------------------
DROP TABLE IF EXISTS `t_product_perpetual`;
CREATE TABLE `t_product_perpetual`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `symbol` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '标志',
  `code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '代号',
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `trading_unit_min` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '交易单位（最小）（手）',
  `trading_unit_max` decimal(15, 4) NULL DEFAULT 20.0000 COMMENT '交易单位（最大）（手）',
  `margin_ratio` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '保证金比例（20倍/50倍并存）',
  `margin_money` decimal(15, 4) NULL DEFAULT 320.0000 COMMENT '保证金（USDT）',
  `quotation_unit` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报价单位（USDT）',
  `service_fee` decimal(15, 4) NULL DEFAULT NULL COMMENT '手续费（USDT/手）',
  `close_fee` decimal(15, 4) NULL DEFAULT NULL COMMENT '平仓手续费',
  `slippage` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '滑点（USDT）',
  `spread_up` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '向上点差',
  `spread_down` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '向下点差',
  `token_spread_up` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '体验金看涨点差',
  `token_spread_down` decimal(15, 4) NULL DEFAULT 0.0000 COMMENT '体验金看跌点差',
  `stop_profit_loss_range` decimal(15, 4) NULL DEFAULT NULL COMMENT '挂单止盈止损范围（USDT）',
  `forced_flat_ratio` decimal(2, 1) NULL DEFAULT NULL COMMENT '强制平仓比例（%）',
  `is_sort` int(2) NULL DEFAULT NULL COMMENT '是否排序',
  `contract_value` int(11) NULL DEFAULT NULL COMMENT '固定合约金额交易对一手合约价值',
  `profit_loss_value` int(11) NULL DEFAULT 0 COMMENT '点位盈亏',
  `status` int(1) NULL DEFAULT NULL COMMENT '状态:0-禁用,1-启用',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

