-- ----------------------------
-- Table structure for t_push
-- ----------------------------
DROP TABLE IF EXISTS `t_push`;
CREATE TABLE `t_push`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `tel` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '手机号',
  `symbol` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易对',
  `direction` tinyint(1) NULL DEFAULT NULL COMMENT '方向（涨/跌）：1-买跌，2-买涨',
  `type` tinyint(2) NOT NULL COMMENT '类型：1盈利，2充值，3下单',
  `product_type` tinyint(2) NULL DEFAULT NULL COMMENT '产品类型：1微合约，2永续合约，3虚拟单',
  `amount` decimal(15, 4) NULL DEFAULT NULL COMMENT '金额',
  `status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '状态：0未推送，1已推送',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_recharge_order
-- ----------------------------
DROP TABLE IF EXISTS `t_recharge_order`;
CREATE TABLE `t_recharge_order`  (
  `order_no` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商户订单号',
  `user_id` bigint(20) NOT NULL COMMENT '买家姓名（userId）',
  `accept_dealer_id` bigint(20) NULL DEFAULT NULL COMMENT '代理商id',
  `order_currency` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '订单币种，固定值：USDT或CNY',
  `order_amount` decimal(15, 4) NULL DEFAULT NULL COMMENT '订单金额，USDT单位个，CNY单位元',
  `exchange_rate` decimal(15, 4) NULL DEFAULT NULL COMMENT '汇率',
  `exchange_amount` decimal(15, 4) NULL DEFAULT NULL COMMENT '兑换后金额',
  `receive_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '通知回调地址',
  `pickup_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易完成后跳转URL',
  `sign_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '签名算法，目前为固定值：MD5',
  `sign` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '参数签名',
  `transaction_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '平台流水号',
  `status` tinyint(2) NOT NULL COMMENT '状态：1待审核，2待转账，3审核通过，4审核不通过，5已关闭',
  `type` tinyint(2) NOT NULL COMMENT '类型：1用户充值，2人工充值，3人工充值（体验金），4奖励金转入',
  `transfer_time` datetime(0) NULL DEFAULT NULL COMMENT '转账时间',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `auditor` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '审核人',
  `audit_time` datetime(0) NULL DEFAULT NULL COMMENT '审核时间',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`order_no`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_ticker
